pragma solidity ^0.8.0;
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
// import "./ERC721.sol";
// CryptoTweets smart contract inherits ERC721 interface
contract CryptoTweets is ERC721URIStorage, ReentrancyGuard {

    using Counters for Counters.Counter; 
    Counters.Counter public CryptoTweetCounter;  // total number of CryptoTweets minted
    Counters.Counter private CryptoTweetSoldCounter;  // total number of CryptoTweets minted

    // initialize contract while deployment with contract's collection name and token
    constructor() ERC721("Crypto Tweets Collection", "CT") { 
     }

    // define CryptoTweet struct
    struct CryptoTweet {
      uint256 tokenId;
      bool filetype; //image false, video true. 
      string tokenName;
      string tokenSymbol;
      string tokenDesc;
      uint256 price;
      string tokenURI;
      bool sold;
      uint256 saleOption;  //
      address payable mintedBy;
      address payable currentOwner;
      address payable previousOwner;
      uint256 numberOfTransfers;
    }

    // map CryptoTweet's token id to CryptoTweet
    mapping(uint256 => CryptoTweet) private allCryptoTweets;
    // check if token name exists
    mapping(string => bool) public tokenNameExists;
    // check if token URI exists
    mapping(string => bool) public tokenURIExists;

    event CryptoTweetCreated(    
      uint256 indexed tokenId,
      bool filetype, //image false, video true. 
      string tokenName,
      string tokenSymbol,
      string tokenDesc,
      uint256 price,
      string tokenURI,
      bool sold,
      uint256 indexed saleOption,  //
      address payable mintedBy,
      address payable currentOwner,
      address payable previousOwner,
      uint256 indexed numberOfTransfers
    );
    // mint a new CryptoTweet
    function mintCryptoTweet(string memory _name,bool _filetype, string memory _symbol,string memory _desc, uint256 _price, string memory _tokenURI,uint256 _option) external nonReentrant {  
      require(_price > 0, "Price must be at least 1 wei");
      // check if thic fucntion caller is not an zero address account
      require(msg.sender != address(0));
      // increment counter
      CryptoTweetCounter.increment();
      // check if a token exists with the above token id => incremented counter
      require(!_exists(CryptoTweetCounter.current()));

      // check if the token URI already exists or not
      require(!tokenURIExists[_tokenURI]);
      // check if the token name already exists or not
      require(!tokenNameExists[_name]);

      // mint the token
      _mint(msg.sender, CryptoTweetCounter.current());
      // set token URI (bind token id with the passed in token URI)
      _setTokenURI(CryptoTweetCounter.current(), _tokenURI);
      // setApprovalForAll(contractAddress, true);

      // make passed token URI as exists
      tokenURIExists[_tokenURI] = true;
      // make token name passed as exists
      tokenNameExists[_name] = true;

      // creat a new CryptoTweet (struct) and pass in new values
      CryptoTweet memory newCryptoBoy = CryptoTweet(
        CryptoTweetCounter.current(),
        _filetype,
        _name,
        _symbol,
        _desc,
        _price,      
        _tokenURI,
        true,
        _option,
        payable(msg.sender),
        payable(msg.sender),
        payable(address(0)),
        0
      );
      allCryptoTweets[CryptoTweetCounter.current()] = newCryptoBoy;
      emit CryptoTweetCreated(
        CryptoTweetCounter.current(),
        _filetype,
        _name,
        _symbol,
        _desc,
        _price,
        _tokenURI,
        true,
        _option,
        payable(msg.sender),
        payable(msg.sender),
        payable(address(0)),
        0
      );
    }
    /* Returns all  market items */
    function fetchCryptoTweets() public view returns (CryptoTweet[] memory) {
      uint256 itemCount = CryptoTweetCounter.current();

      CryptoTweet[] memory items = new CryptoTweet[](itemCount);
      for (uint256 i = 0; i < itemCount; i++) {
          uint256 currentId = i + 1;
          CryptoTweet storage currentItem = allCryptoTweets[currentId];
          items[i] = currentItem;
      }
      return items;
    }
    /* Returns all unsold market items */
    // function fetchUnsoldCryptoTweets() public view returns (CryptoTweet[] memory) {
    //   uint256 itemCount = CryptoTweetCounter.current();
    //   uint256 unsoldItemCount = CryptoTweetCounter.current() - CryptoTweetSoldCounter.current();
    //   uint256 currentIndex = 0;

    //   CryptoTweet[] memory items = new CryptoTweet[](unsoldItemCount);
    //   for (uint256 i = 0; i < itemCount; i++) {
    //     if (allCryptoTweets[i + 1].previousOwner == address(0)) {
    //       uint256 currentId = i + 1;
    //       CryptoTweet storage currentItem = allCryptoTweets[currentId];
    //       items[currentIndex] = currentItem;
    //       currentIndex += 1;
    //     }
    //   }
    //   return items;
    // }

  /* Returns only items that a user has owned */
    function fetchMyNFTs() public view returns (CryptoTweet[] memory) {
      uint256 totalItemCount = CryptoTweetCounter.current();
      uint256 itemCount = 0;
      uint256 currentIndex = 0;

      for (uint256 i = 0; i < totalItemCount; i++) {
        if (allCryptoTweets[i + 1].currentOwner ==msg.sender) {
          itemCount += 1;
        }
      }
      CryptoTweet[] memory items = new CryptoTweet[](itemCount);
      for (uint256 i = 0; i < totalItemCount; i++) {
        if (allCryptoTweets[i + 1].currentOwner ==msg.sender) {
          uint256 currentId = i + 1;
          CryptoTweet storage currentItem = allCryptoTweets[currentId];
          items[currentIndex] = currentItem;
          currentIndex += 1;
        }
      }
      return items;
    }
    // get owner of the token
    function getTokenOwner(uint256 _tokenId) public view returns(address) {
      address _tokenOwner = ownerOf(_tokenId);
      return _tokenOwner;
    }

    // get metadata of the token
    function getTokenMetaData(uint256 _tokenId) public view returns(string memory) {
      string memory tokenMetaData = tokenURI(_tokenId);
      return tokenMetaData;
    }

    // get total number of tokens owned by an address
    function getTotalNumberOfTokensOwnedByAnAddress(address _owner) public view returns(uint256) {
      uint256 totalNumberOfTokensOwned = balanceOf(_owner);
      return totalNumberOfTokensOwned;
    }

    // check if the token already exists
    function getTokenExists(uint256 _tokenId) public view returns(bool) {
      bool tokenExists = _exists(_tokenId);
      return tokenExists;
    }

    // by a token by passing in the token's id
    function buyToken(uint256 _tokenId) public payable {
      // check if the function caller is not an zero account address
      require(msg.sender != address(0),"Buyer is not an zero account address");
      // check if the token id of the token being bought exists or not
      require(_exists(_tokenId));
      address tokenOwner = ownerOf(_tokenId);
      // token's owner should not be an zero address account
      require(tokenOwner != address(0),"Owner should not be an zero address account");
      // the one who wants to buy the token should not be the token's owner
      require(tokenOwner != msg.sender,"Owner can not buy his own token");
      // get that token from all CryptoTweets mapping and create a memory of it defined as (struct => CryptoTweet)
      CryptoTweet memory CryptoTweet = allCryptoTweets[_tokenId];
      // price sent in to buy should be equal to or more than the token's price
      // require(msg.value >= CryptoTweet.price,"Buyer's balance must be greater than token price");
      // token should be for sale
      require(CryptoTweet.sold,"This token is not for sale");
      // transfer the token from owner to the caller of the function (buyer)
      _transfer(CryptoTweet.currentOwner, msg.sender, _tokenId);
      // get owner of the token
      address payable sendTo = CryptoTweet.currentOwner;
      // send token's worth of ethers to the owner
      sendTo.transfer(msg.value);
      // update the token's previous owner
      CryptoTweet.previousOwner = CryptoTweet.currentOwner;
      // update the token's current owner
      CryptoTweet.currentOwner = payable(msg.sender);
      // update the how many times this token was transfered
      CryptoTweetSoldCounter.increment();
      CryptoTweet.numberOfTransfers=CryptoTweetSoldCounter.current();
      // set and update that token in the mapping
      allCryptoTweets[_tokenId] = CryptoTweet;
    }

    function changeTokenPrice(uint256 _tokenId, uint256 _newPrice) public {
      // require caller of the function is not an empty address
      require(msg.sender != address(0));
      // require that token should exist
      require(_exists(_tokenId));
      // get the token's owner
      address tokenOwner = ownerOf(_tokenId);
      // check that token's owner should be equal to the caller of the function
      require(tokenOwner == msg.sender);
      // get that token from all CryptoTweets mapping and create a memory of it defined as (struct => CryptoTweet)
      CryptoTweet memory cryptoTweet = allCryptoTweets[_tokenId];
      // update token's price with new price
      cryptoTweet.price = _newPrice;
      // set and update that token in the mapping
      allCryptoTweets[_tokenId] = cryptoTweet;
    }

    // switch between set for sale and set not for sale
    function toggleForSale(uint256 _tokenId) public {
      // require caller of the function is not an empty address
      require(msg.sender != address(0));
      // require that token should exist
      require(_exists(_tokenId));
      // get the token's owner
      address tokenOwner = ownerOf(_tokenId);
      // check that token's owner should be equal to the caller of the function
      require(tokenOwner == msg.sender);
      // get that token from all CryptoTweets mapping and create a memory of it defined as (struct => CryptoTweet)
      CryptoTweet memory cryptoTweet = allCryptoTweets[_tokenId];
      // if token's forSale is false make it true and vice versa
      if(cryptoTweet.sold) {
        cryptoTweet.sold = false;
      } else {
        cryptoTweet.sold = true;
      }
      // set and update that token in the mapping
      allCryptoTweets[_tokenId] = cryptoTweet;
    }
}
